import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './App.css';
import Navbar_me from './layouts/Navbar';
import Slider from './layouts/Slider';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar_me/>
        <Slider/>
        <Switch>

        </Switch>
      </div>
    </Router>
  );
}

export default App;
